// import HorizentalLine from "./horizentalLine.js"
// import "./mypageSel.css"

function myPageSel(){
return (
    <div> 
        
            <div>
                <div className = "">
                <a className = "" href = ""><h1>MyPage</h1></a>
                </div>
                
            
                <ul className = "">
                    <li className = "">
                        <a className = "" href = "">기본정보</a>
                    </li>
                    <li className = "">
                        <a className = "" href = "">영양제 취향 정보</a>
                    </li>
                    <li className = "">
                        <a className = "" href = "">나의 약장</a>
                    </li>
                    <li className = "">
                        <a className = "" href = "">회원탈퇴</a>
                    </li>
                </ul>
            
            
        </div>
    


       
    </div>
    );
}

export default myPageSel;


